import logo from './logo7.png';
import { useState } from 'react';
import './App.css';
import TopicSelector from './components/TopicSelector';
import PlotGenerator from './components/PlotGenerator';
import Chatbox from './components/chatbox';
import Calculator from './components/Calculator';
import ExamGrader from './components/ExamGrader';

import Button from './components/ui/button';
import { Card, CardHeader, CardTitle, CardContent } from './components/ui/card';
import { FaBook, FaChartLine, FaComments, FaCalculator, FaGraduationCap } from 'react-icons/fa'; // Import icons

function App() {
  const [selectedComponent, setSelectedComponent] = useState(null);

  const renderComponent = () => {
    switch (selectedComponent) {
      case 'TopicSelector':
        return <TopicSelector />;
      case 'PlotGenerator':
        return <PlotGenerator />;
      case 'Chatbox':
        return <Chatbox />;
      case 'Calculator':
        return <Calculator />;
      case 'ExamGrader':
        return <ExamGrader />;
      default:
        return (
          <Card className="text-center p-6 mx-auto border border-gray-200 shadow-lg">
            <CardHeader>
              <CardTitle className="text-gray-600 text-lg font-light">
                Click on a button to load a component
              </CardTitle>
            </CardHeader>
          </Card>
        );
    }
  };

  return (
<div className="App bg-blue-50 min-h-screen flex flex-col">
  {/* Full-width Welcome Section */}
  <header className="bg-blue-800 py-12 shadow-md w-full">
    {selectedComponent === null && (
      <div className="bg-blue-800 w-full text-center p-8 flex flex-col items-center lg:flex-row lg:justify-center lg:text-left">
  <div className="lg:w-1/2">
    <h1 className="text-4xl font-bold text-white">Welcome</h1>
    <p className="text-white text-lg mt-2">
      Make a choice from the options below to explore various features.
    </p>
  </div>
  <div className="lg:w-1/2 flex justify-center lg:justify-end mt-6 lg:mt-0">
    <img
      src={logo}
      className="rounded-lg shadow-md"
      alt="logo"
      style={{ width: '400px', height: '300px' }}
    />
  </div>
</div>
    )}
  </header>

  {/* Button Section */}
  <main className="flex-grow flex flex-col items-center justify-center px-4 m-0 p-0 w-full">

    <div className="flex flex-wrap justify-center gap-4 w-full">
      <Button
        variant="default"
        className="flex items-center space-x-2 w-64"
        onClick={() => setSelectedComponent('TopicSelector')}
      >
        <FaBook /> <span>Course Helper</span>
      </Button>
      <Button
        variant="default"
        className="flex items-center space-x-2 w-64"
        onClick={() => setSelectedComponent('PlotGenerator')}
      >
        <FaChartLine /> <span>Plot Generator</span>
      </Button>
      <Button
        variant="default"
        className="flex items-center space-x-2 w-64"
        onClick={() => setSelectedComponent('Chatbox')}
      >
        <FaComments /> <span>Chatbox</span>
      </Button>
      <Button
        variant="default"
        className="flex items-center space-x-2 w-64"
        onClick={() => setSelectedComponent('Calculator')}
      >
        <FaCalculator /> <span>Calculator</span>
      </Button>
      <Button
        variant="default"
        className="flex items-center space-x-2 w-64"
        onClick={() => setSelectedComponent('ExamGrader')}
      >
        <FaGraduationCap /> <span>Exam Grader</span>
      </Button>
    </div>

    {/* Rendered Component Section */}
    <div className="mt-12 w-full">{renderComponent()}</div>
  </main>
</div>

  );
}

export default App;
